INSERT INTO `coconut_tasks` (`task_id`, `task_name`, `weatherRestrictions`, `details`, `requiredTemperature_min`, `requiredTemperature_max`, `idealHumidity_min`, `idealHumidity_max`, `requiredWindSpeed_max`, `requiredWindGust_max`, `requiredCloudCover_max`, `requiredPressure_min`, `requiredPressure_max`) VALUES
(1, 'Harvesting coconuts', '[500, 800, 801, 802, 803, 804]', 'Harvest coconuts on dry days with mild temperatures and moderate humidity. Avoid heavy rain and strong winds for the best results and fruit quality.', 18, 36, 60, 93, 12, 15, 100, 1000, 1035),
(2, 'Cleaning coconut trees', '[500, 800, 801, 802, 803, 804]', 'Clean coconut trees during mild weather. Avoid moderate or heavy rain for safe and effective maintenance.', 18, 36, 50, 93, 12, 15, 100, 1000, 1035),
(3, 'Applying fertilizer', '[500, 800, 801, 802, 803, 804]', 'Apply fertilizer during dry weather to help nutrient absorption. Avoid heavy rain immediately after application for best results.', 18, 36, 60, 93, 10, 15, 100, 1000, 1035),
(4, 'Watering coconut plants', '[500, 501,800, 801, 802, 803, 804]', 'Water your coconut plants during dry spells to keep the soil moist. You can also water them on mild rainy days, as the rain will help and make it more effective. Just choose a calm day for best results!', 18, 36, 50, 96, 12, 15, 100, 1000, 1035),
(5, 'Inspecting for pests', '[500, 501, 800, 801, 802, 803, 804]', 'Rain makes pests more visible as they seek shelter on plants. Moderate rain helps spot them, but heavy rain reduces visibility. This applies to smaller plants, not mature coconut trees.', 18, 36, 50, 96, 15, 20, 100, 1000, 1035),
(6, 'Transplanting coconut seedlings', '[500, 800, 801, 802, 803, 804]', 'Transplant coconut seedlings during mild weather, preferably in the early morning or late afternoon for optimal growth.', 18, 36, 60, 93, 10, 15, 100, 1000, 1035),
(7, 'Pruning coconut palms', '[500, 800, 801, 802, 803, 804]', 'Prune coconut palms during mild weather to remove dead or diseased leaves. Avoid strong winds for safer pruning.', 18, 36, 50, 93, 10, 12, 100, 1000, 1035),
(8, 'Mulching around coconut trees', '[500, 800, 801, 802, 803, 804]', 'Mulch around coconut trees during calm weather to help conserve soil moisture and support healthy growth.', 18, 36, 60, 93, 10, 15, 100, 1000, 1035),
(9, 'Monitoring soil health', '[500, 501, 800, 801, 802, 803, 804]', 'You can check soil moisture retention and drainage during moderate rain, as the wet conditions give a clear view of how well the soil holds moisture and drains, helping assess its overall health.', 18, 36, 50, 96, 12, 15, 100, 1000, 1035),
(10, 'Controlling weeds', '[500, 800, 801, 802, 803, 804]', 'Control weeds during mild weather, avoiding heavy rain or strong winds for more effective management.', 18, 36, 50, 93, 10, 15, 100, 1000, 1035),
(11, 'Harvesting coconut sap (tuba)', '[500, 800, 801, 802, 803, 804]', 'Harvest coconut sap early in the morning or evening during calm weather for the best quality.', 18, 36, 60, 93, 15, 20, 100, 980, 1035),
(12, 'Managing irrigation', '[500, 800, 801, 802, 803, 804]', 'Manage irrigation during dry spells to maintain moisture levels and support healthy coconut growth.', 18, 36, 60, 93, 10, 15, 100, 1000, 1035),
(13, 'Monitoring growth', '[500, 800, 801, 802, 803, 804]', 'Monitor coconut growth during mild weather to ensure healthy development and optimal growing conditions.', 18, 36, 50, 93, 12, 15, 100, 1000, 1035),
(14, 'Land Preparation', '[500, 800, 801, 802, 803, 804]', 'Prepare land during dry weather to ensure optimal soil conditions for planting coconut seedlings.', 18, 36, 50, 93, 12, 15, 100, 1000, 1035),
(15, 'Planting Coconut Seedlings', '[500, 501, 800, 801, 802, 803, 804]', 'You can plant coconut seedlings during mild rainy day to ensure adequate water supply for growth.', 18, 36, 60, 96, 10, 15, 100, 1000, 1035),
(16, 'Post-Harvest Processing', '[500, 800, 801, 802, 803, 804]', 'Conduct post-harvest processing during dry weather to ensure optimal quality and ease of handling.', 18, 36, 50, 93, 12, 15, 100, 1000, 1035);
